import React, { Component } from "react";

class About extends Component {
  state = {};
  render() {
    return (
      <section className="">
        <div className="container-fluid">
          <div className="row">
            <div className="col-lg-6">
              <h1>
                <i className="icon waves" />
                <span className="">
                  About <br> me</br>
                </span>
              </h1>
            </div>
            <div className="col-lg-6" />
          </div>
        </div>
      </section>
    );
  }
}

export default About;
